typedef struct 
{
	unsigned char bufPlate[20];             // 号牌识别结果
	unsigned char bufVehiColor[5];			// 车身颜色识别结果
	unsigned char bufColorSature[5];		// 车身颜色深浅
	unsigned char bufVehiType[10];			// 车标识别结果
	unsigned char bufReservedChar[20];		// 号牌识别保留char型数组;
	float fRecogProbility;					// 号牌识别概率，0 至 1 之间的小数
	float fPlateGrayLevel;					// 号牌灰度级别，用于判断牌照的亮度是否合理，指导摄像头曝光的。特别注意的是该变量只对蓝色牌照有返回结果，其余颜色牌照均返回0.0；
	int IsPlateExist;						// 是否识别出号牌； false 为未识别，true 为有识别，所有的应用都应先判断是否有识别结果后再进行
	int iPlateStructure;					// 号牌结构，0=其他，1=单排，2=武警，3=警用，4=双排
	int iPlateColor;						// 号牌颜色，0 为白色，1 为黄色，2 为蓝色，3 为黑色，4 为未知
	int iPlateHeight;						// 号牌的高度 (以像素点个数为单位)
	int iPlateWidth;						// 号牌的宽度 (以像素点个数为单位)
	int iPlateAngle;						// 号牌倾斜角度，1、3象限为负数，2、4象限为正数
	int bufPlatePosition[4];				// 号牌在图像中的位置 (bufPlatePosition[0]=号牌上边界的横坐标、bufPlatePosition[1]=号牌下边界的横坐标、bufPlatePosition[2]=号牌左边界的纵坐标、bufPlatePosition[3]=号牌右边界的纵坐标)
	int *bufPlateHistGramData;				// 号牌区域的灰度直方图
	int bufReservedInt[10];					// 号牌识别保留int型数组;

}LPR;

typedef struct  
{
	short startX;
	short startY;
	short width;
	short height;
	LPR   recogResult;
}RecogRect;

typedef struct  
{
	short x;
	short y;
}Point;

